INSERT INTO `mt_custom_page` VALUES (1,'quem-somos','Quem somos','<p><span style=\"font-family:Verdana, Geneva, sans-serif;font-size:18px;\"><strong>Quem somos?</strong></span></p>\n<p><span style=\"font-family:Verdana, Geneva, sans-serif;\">Somos uma empresa que chegou para facilitar a vida do cliente e apoiar as padarias no atendimento rápido e com qualidade.</span></p>\n<p><span style=\"font-family:Verdana, Geneva, sans-serif;\">Surgimos de uma necessidade em ter que sair todos os dias para comprar o pão na padaria, por isso, criamos o iPaoo que traz a padaria mais próxima na palma da sua mão.</span></p>\n<p><span style=\"font-family:Verdana, Geneva, sans-serif;\">É complicado ir a padaria concorda? Se sim o iPaoo chegou para fazer isso com excelência, <span style=\"color:rgb(0,0,0);font-family:Verdana, Geneva, sans-serif;font-size:medium;font-style:normal;font-weight:400;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;float:none;\">a padaria da sua região recebe o seu pedido, separa a entrega e levar na porta da sua casa.</span> </span></p>\n<p><span style=\"font-family:Verdana, Geneva, sans-serif;\">Somos uma empresa de tecnologia, me chamo Marcio Takara e sou o CEO da empresa iPaoo. Se você quiser saber mais sobre mim, sou Formado em ADM e MBA em Gestão Estratégica da Tecnologia da Informação com mais de 12 anos de experiência em Gestão, liderança e novas soluções em TI nas empresas.</span></p>\n<p><span style=\"font-family:Verdana, Geneva, sans-serif;\">Nascido em Junho 2019, também chegamos do forno agora. O iPaoo é uma empresa focada na tecnologia em padarias e por isso criamos o app chamado iPaoo para facilitar a vida dos clientes, com o app você poderá encontrar todos os produtos da Padaria.</span></p>\n<p><span style=\"font-family:Verdana, Geneva, sans-serif;\">Nosso foco é o nosso App chamado iPaoo que está disponível em Google Play Android e App Store IOS.</span></p>\n<p>\n  <br /></p>\n<p><span style=\"font-family:Arial, Helvetica, sans-serif;font-size:18px;\"><strong>iPaoo -  a padaria na porta da sua casa!</strong></span></p>','Quem somos ','IPaoo o delivery de padaria que entrega o seu pao na porta da sua casa','iPaoo o aplicativo que leva a padaria até a porta da sua casa','Quem Somos','bottom2',8,'publish','2019-11-24 22:33:59','2020-01-08 23:38:44','189.79.97.21',2,1),(5,'privacy-policy','Política de Privacidade','<span style=\"color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;font-size:20px;\"><span style=\"font-size:24px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Política de Privacidade</span></span></span><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">São Paulo, 11 de Dezembro de 2019</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">LEI Nº 13.709, DE 14 DE AGOSTO DE 2018 - Lei Geral de Proteção de dados LGPD</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Responsável legal pelas informações dos usuários: OPTIT Informática Ltda, do CNPJ: 30.314.463/0001-99.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Sem bem vinda(o) ao iPaoo, seguimos as regras estabelecidas pela LEI 13.709 sancionada pelo Presidente da República. </h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Vamos utilizamos os seus dados como parte da nossa missão de proporcionar um serviço de qualidade cada vez maior. Essa política descreve como obtemos, armazenamos, utilizamos e compartilhamos as suas informações.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">A proteção dos seus dados e da sua privacidade são muito importantes para o iPaoo. Portanto, convidamos para que você conheça as nossas melhores práticas e, em caso de dúvidas, entre em contato conosco no email ipaoo@ipaoo.com.br.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Você consente, de forma livre e expressa, que seus dados e informações sejam coletados, armazenados, tratados e compartilhados, conforme as regras dispostas nesta Política de Privacidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ao se cadastrar no iPaoo, o usuário garante de forma expressa que é plenamente capaz, nos termos da legislação vigente, para exercer e gozar de todos os Serviços. Aos demais usuários menores de 18 anos deverão obter o consentimento expresso de seus pais, tutores ou representantes legais para utilizar os serviços, conforme as disposições dos Termos e da Política de Privacidade do iPaoo. Os pais, tutores ou representantes legais serão plenamente responsáveis também no caso de acesso ao iPaoo por parte de crianças e adolescentes, sem a devida obtenção de autorização prévia. Cabe a eles a integral responsabilidade pela fiscalização das atividades e conduta dos respectivos menores sob sua tutela, bem como ciência da integralidade dos presentes Termos.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Informamos ainda a você que o serviço prestado pelo iPaoo não é direcionado a adolescentes e crianças menores de 13 anos.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Informações não-pessoais</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós também podemos obter informações não-pessoais, ou seja, dados que não permitem a associação direta com qualquer pessoa especificamente. São exemplos de dados não-pessoais a idade do indivíduo, preferencias individuais, idioma, CEP e código de área.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós também poderemos obter informações sobre as atividades dos usuários no nosso Website ou Aplicativo. Essas informações são agregadas e usadas para nos ajudar a fornecer informações para os nossos clientes e entender quais partes dos nossos produtos e serviços atraem mais interesse dos usuários. Dados agregados são considerados informações não-pessoais para fins desta Política de Privacidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Se combinarmos informações não-pessoais com informações pessoais, a informação combinada será tratada como informação pessoal enquanto essa informação permanecer combinada.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\"><b style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como utilizamos essas informações?</b></span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);font-size:18px;line-height:1.1;margin-bottom:18px;\">Promover, melhorar e desenvolver nossos serviços</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Podemos usar essas informações coletadas para nos ajudar a desenvolver, oferecer e melhorar os nossos produtos e serviços destinados a você, existentes ou serem criados.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Também poderemos usar suas informações pessoais para fins internos, tais como auditoria, análise de dados e pesquisas para aprimorar os produtos, serviços e comunicações com os clientes, e geração de análises estatísticas com respeito ao uso dos nossos serviços, incluindo tendências de consumo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;font-size:20px;\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Avaliação de estabelecimentos</span></span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ao enviar comentários e feedback com relação ao Website ou Aplicativo e os serviços de delivery dos nossos parceiros, você nos autoriza a publicar e utilizar tais comentários e feedbacks no Website ou Aplicativo e em quaisquer materiais de marketing ou publicidade, bem como a analisar, processar e tratar esse feedback de forma isolada ou agregada nos termos desta política de privacidade. Para tanto, apenas identificamos você através de seu nome de cadastro, foto do perfil do iPaoo (caso você tenha uma) e da sua cidade de residência.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Comunicação</span></span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Periodicamente poderemos usar suas informações pessoais para enviar avisos e notificações importantes, como comunicados sobre compras, alterações em prazos, condições e políticas. Como estas informações são importantes para a sua interação com o iPaoo, você não poderá optar por não receber esse tipo de comunicação, já que são inerentes ao uso do serviço.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Marketing</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós poderemos usar suas informações pessoais para enviar publicidade, bem como outros materiais promocionais voltados ao marketing de nossos serviços e de novidades para você, o que inclui campanhas digitais (tais como marketing direcionado em redes sociais e notificações push) e não digitais (como divulgação em radiodifusão, outdoors, panfletos, entre outros).</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nesse caso, você pode optar por não receber mais e-mails de marketing a qualquer momento, alterando as suas preferências.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Além disso, poderemos compartilhar as informações com parceiros do iPaoo, para fins de desenvolver campanhas de marketing mais relevantes para interessados nos produtos do iPaoo. O iPaoo somente compartilhará dados com parceiros que possuírem política de privacidade que ofereça níveis compatíveis de proteção àquele oferecido por esta política.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Promoções</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Se você participar de um concurso, competição ou qualquer outra modalidade de promoção, poderemos usar as informações que você fornecer para administrar esses programas.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Dados não-pessoais</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós poderemos usar informações não-pessoais para a consecução das finalidades previstas nessa Política de Privacidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);font-size:20px;line-height:1.1;margin-bottom:18px;\">Como utilizamos cookies e outras tecnologias?</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">O iPaoo se utiliza de tecnologias como cookies, pixel tags, armazenamento local ou outros identificadores, tanto de dispositivos móveis ou não, ou tecnologias semelhantes (“cookies e outras tecnologias”), para uma variedade de funções. Essas tecnologias nos ajudam a autenticar a sua conta, promover e aperfeiçoar os serviços do iPaoo, personalizar a sua experiência e avaliar a eficácia da nossa comunicação e publicidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">O que são essas tecnologias?</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Cookies são pequenos arquivos armazenados no seu navegador, celular ou outro dispositivo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Pixel tags (ou GIFs limpos, web beacons ou pixels) são pequenos blocos de código em uma página da web que permitem que elas realizem ações como ler e armazenar cookies e transmitir informações para o iPaoo. A conexão resultante pode incluir informações como o endereço de IP de um dispositivo, a hora em que uma pessoa visualizou o pixel, um identificador associado ao navegador ou dispositivo e o tipo de navegador em uso.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Identificadores de dispositivo mobile são códigos que possibilitam a identificação do seu dispositivo mobile, seja de maneira persistente ou transitória, tais como o ID de Publicidade ou o ID de seu sistema operacional.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Armazenamento local é uma tecnologia padrão da indústria que permite que um website ou aplicativo armazene e recupere dados do computador, celular ou outro dispositivo de uma pessoa. </h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);font-size:18px;line-height:1.1;margin-bottom:18px;\">Como funcionam?</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Cookies e outras tecnologias nos ajudam a melhor prestar os nossos serviços a você, bem como a entender melhor o seu comportamento, nos dizendo quais partes de nosso Website ou Aplicativo as pessoas visitaram e, ainda, facilitam a medição da eficácia da publicidade e das pesquisas na web.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós tratamos as informações obtidas por meio de cookies e outras tecnologias como informações não-pessoais. Entretanto, na medida em que o endereço protocolo de internet (endereço IP) ou identificadores semelhantes sejam considerados informações pessoais pela lei local aplicável, nós também trataremos esses identificadores como informação pessoal.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Da mesma forma, na medida em que a informação não-pessoal seja combinada com informação pessoal, nós tratamos a informação combinada como informação pessoal para os fins desta Política de Privacidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Você pode gerenciar as suas preferências de cookies e outras tecnologias semelhantes a partir da configuração de seu navegador ou dispositivo, recusando ou excluindo determinados cookies e outros tecnologias. Contudo, isso poderá comprometer a prestação dos nossos serviços ou impedir o funcionamento de determinadas funcionalidades que os integram.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Os nomes específicos dos cookies e outras tecnologias usados podem variar à medida em que os nossos serviços são melhorados e atualizados, mas eles geralmente se restringem às categorias de uso abaixo:</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Categorias de uso</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Exemplos</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Autenticação</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Indica que você está conectado, para que seja possível oferecê-lo os recursos apropriados, bem como para entender como você usa nossos serviços.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Segurança e integridade</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ajuda a manter a segurança dos nossos serviços, oferecendo suporte ou ativando recursos de segurança e ajudando a detectar atividades que violam nossos Termos e Condições de Uso e Política de Privacidade. Por exemplo, auxilia a proteger a sua conta contra acessos indesejados.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Anúncios, ideias e medição</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ajuda a analisar comportamentos de navegação, a fim de veicular e medir anúncios, torná-los mais relevantes para você e analisar o conteúdo e uso de produtos e serviços. Por exemplo, é possível usar um cookie ou outra tecnologia para descobrir se alguém que tenha sido exposto a um anúncio realiza uma compra relacionada ao anúncio.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Recursos e serviços</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ajuda a fornecer produtos e serviços. Por exemplo, quando você vê ou interage com conteúdo dos nossos serviços, é possível oferecer a você outros plug-ins sociais, diferentes experiências e conteúdo personalizado.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Desempenho</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ajuda a proporcionar a melhor experiência possível, por exemplo, ajudando a rotear o tráfego entre servidores e perceber com que velocidade o serviço do iPaoo é carregado para diferentes pessoas. Ocasionalmente, poderão ser armazenadas informações no seu navegador ou dispositivo para que os recursos em uso carreguem e respondam rapidamente.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Análises e pesquisas</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ajuda a entender, aprimorar e pesquisar produtos e serviços quando você acessa o iPaoo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Promover uma experiência personalizada</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">O iPaoo e os seus parceiros também usam cookies e outras tecnologias para memorizar informações pessoais quando você usa o nosso Website, Aplicativo ou a rede de parceiros do iPaoo que possam usar tecnologias similares. A nossa meta nesses casos é fazer com que a sua experiência com o iPaoo seja mais conveniente e personalizada.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Por exemplo, saber o seu primeiro nome nos permite dar boas-vindas a você na próxima vez em que você acessar o iPaoo. Conhecer seu país e idioma nos permite viabilizar a você uma experiência de compras personalizada e mais útil. Saber que você adquiriu determinado produto ou usou um determinado serviço permite fazer com que sua publicidade e comunicações de e-mail sejam mais relevantes para os seus interesses.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nessa linha, podemos também usar essas informações para classificar os usuários dentro da rede iPaoo, identificando os usuários a partir de eventos realizados, como a primeira compra ou o download do nosso aplicativo, e a partir de determinadas características de seu perfil, como usuários que pedem mais determinada categoria de comida ou que realizam mais de 4 pedidos por mês.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Avaliar a eficácia da nossa comunicação e publicidade</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós usamos essas informações também para entender e analisar tendências, administrar os nossos serviços, aprender sobre o comportamento do usuário e obter informações demográficas sobre a nossa base de usuários de maneira geral. Em algumas de nossas mensagens de e-mail, nós usamos uma \"URL click-through\" (endereço externo) vinculada ao conteúdo do iPaoo. Quando os clientes clicam em uma dessas URLs, os usuários são enviados para um servidor diferente antes de chegarem à página de destino no nosso serviço.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós monitoramos esses dados de click-through para entender o interesse em determinados tópicos e avaliar a eficácia das comunicações com os nossos clientes. Se você preferir não ser monitorado dessa maneira, não clique em texto ou links contidos em mensagens de e-mail enviadas pelo iPaoo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Os pixel tags nos permitem enviar mensagens de e-mail em formatos que os usuários possam ler e nos dizer se o e-mail foi aberto ou não. Nós podemos usar essas informações para reduzir ou eliminar as mensagens enviadas aos usuários.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Tecnologia de terceiros</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Além dos cookies e outras tecnologias do iPaoo, nós podemos permitir que terceiros contratados pelo iPaoo utilizem cookies e outras tecnologias de sua propriedade para identificar seu navegador e dispositivo, de modo a lhe oferecer publicidade direcionada do iPaoo quando você acessa websites ou aplicativos de terceiros.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Esses terceiros podem também fornecer ao iPaoo informações acerca do desempenho das campanhas de marketing desenvolvidas.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">algumas dessas empresas podem utilizar cookies e outras tecnologias próprios nos serviços do iPaoo, tais como: Facebook Google Analytics e Double Click.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como as informações são armazenadas?</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Por quanto tempo as informações são armazenadas?</span></span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">O iPaoo armazena as suas informações durante o período necessário para as finalidades apresentadas nos Termos e Condições de Uso do iPaoo e nesta Política de Privacidade, respeitando o período de retenção de dados determinado pela legislação aplicável..</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Caso você solicite a exclusão de sua conta, as suas informações pessoais fornecidas ao iPaoo durante a sua utilização dos nossos serviços serão excluídos definitivamente sempre que a legislação assim o exigir.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Em alguns casos, poderemos reter suas informações mesmo que você exclua sua conta, tais como nas hipóteses de guarda obrigatória de registros previstas na lei aplicável, se houver uma questão não resolvida relacionada à sua conta (como, por exemplo, uma reclamação ou disputa não resolvida), ou caso seja necessário para nossos interesses comerciais legítimos, como prevenção de fraudes e aprimoramento da segurança dos nossos usuários.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como as informações são compartilhadas?</span></span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Além das finalidades descritas acima, nós podemos também compartilhar com terceiros as suas informações coletadas em algumas hipóteses, que descreveremos abaixo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Para outros usuários do iPaoo</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Quando você se inscreve nos nossos serviços e submete suas informações pessoais para criar um perfil ou coleção visual, outros usuários verão seu nome e foto.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Caso você tenha optado por fornecer informações pessoais adicionais em seu perfil, os usuários do iPaoo também verão essas informações adicionais, incluindo, mas não se limitando a, website e informações biográficas. Fornecer informação adicional é uma opção sua. Nós recomendamos que você proteja e não divulgue na internet nenhuma informação que você considere sensível ou confidencial.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><span style=\"color:rgb(255,0,0);font-size:16px;\"><span style=\"font-size:18px;color:rgb(255,0,0);\">Provedores de serviços e outros parceiros</span></span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Por razões de processamento e inteligência em relação aos dados do iPaoo, poderemos também compartilhar informações com algumas empresas ou indivíduos prestadores de serviço ou empresas parceiras do iPaoo. Nesse caso, os dados serão tratados de forma a proteger a sua privacidade, tendo essas empresas dever de proteção compatível com o da política de privacidade do iPaoo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós podemos utilizar os serviços dessas empresas para facilitar nosso serviço, prover o serviço do iPaoo em nosso nome, executar atividades relacionadas ao serviço, incluindo – mas não se limitando a –, manutenção dos serviços, transporte e entrega de compras realizados por você, gerenciamento de banco de dados, análise de dados e melhoria de funcionalidades incluindo marketing, ou auxiliar-nos na avaliação de como o nosso serviço é usado.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Em relação ao pagamento de suas compras no nosso Website ou Aplicativo, caso opte por pagar diretamente online, nós poderemos compartilhar seus dados de pagamento com empresas processadores de pagamento com os quais trabalhamos. Esse compartilhamento é feito com o fim exclusivo de viabilizar a compra efetivada por você.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Essas empresas ou indivíduos têm acesso à sua informação pessoal apenas para executar atividades solicitadas pelo iPaoo e são obrigados a não usar ou divulgar tais informações para nenhuma outra finalidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Estabelecimentos parceiros do iPaoo</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Ao fazer um pedido em um estabelecimento parceiro pelo nosso Website ou Aplicativo, nós podemos compartilhar algumas informações suas com esse estabelecimento parceiro, bem como fornecer dados a respeito do pedido em específico. As informações compartilhadas podem incluir nome, número de telefone, endereço de entrega, CPF (quando for solicitado), entre outras.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Serviços de redes sociais e outros provedores de aplicação</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nós podemos divulgar informações de sua conta no iPaoo (incluindo informações pessoais) para outros provedores de aplicação ligados à sua conta iPaoo. Nós permitimos que você conecte sua conta de serviços de redes sociais e outros provedores de aplicação aos serviços do iPaoo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Dessa forma, você poderá postar atividades recentes em nossos serviços nas suas contas de redes sociais. Se você não quiser mais postar suas atividades em sua conta de rede social, poderá simplesmente fazer isso ou alterar suas preferências quando a opção estiver disponível.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:18px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Para publicidade e serviços de análise</span></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Para poder entregar publicidade e promoções adequadas para você, bem como aperfeiçoar nossos serviços, nós também podemos compartilhar as suas informações com empresas especializadas em marketing e análise de dados digitais que ofereçam nível de proteção de dados compatível com esta política de privacidade.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como respondemos a requerimentos legais?</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">O iPaoo também poderá compartilhar suas informações com autoridades policiais ou judiciais, autoridades públicas competentes ou outros terceiros, dentro e fora do país em que você reside, caso seja requerido pela legislação aplicável, por decisão judicial e por requisição de autoridades, ou se necessário para responder a processos judiciais ou para participar em eventuais litígios ou disputas de qualquer natureza.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nestas situações, o iPaoo cooperará com as autoridades competentes na medida em que discricionariamente entenda necessário e adequado em relação a qualquer investigação de ilícitos, infrações a direitos de propriedade industrial ou intelectual, ou outra atividade que seja ilegal ou que possa expor o iPaoo ou seus usuários a qualquer responsabilidade legal ou lhes impor riscos, ressalvadas hipóteses de sigilo de informações constantes na legislação aplicável.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Além disso, o iPaoo se reserva o direito de compartilhar informações sobre seus usuários a terceiros quando houver motivos suficientes para considerar que a atividade de um usuário é suspeita, ilegal ou prejudicial ao iPaoo ou a terceiros.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Este direito será utilizado pelo iPaoo quando considerar apropriado ou necessário para manter a integridade e a segurança do seu serviço, para o cumprimento dos seus Termos e Condições de Uso e Política de Privacidade, e com o intuito de cooperar com a execução e cumprimento da lei, independentemente de existir ou não uma ordem judicial ou administrativa para tanto.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como protegemos suas informações?</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">O iPaoo emprega seus melhores esforços para respeitar e proteger suas informações pessoais contra perda, roubo ou qualquer modalidade de uso indevido, bem como contra acesso não autorizado, divulgação, alteração e destruição.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Utilizamos o moderno princípio de privacy by design, respeitando a sua privacidade e protegendo seus dados nos nossos processos internos como um todo.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Só tratamos os seus dados mediante alto grau de segurança, implementando as melhores práticas em uso na indústria para a proteção de dados, tais como técnicas de criptografia, monitoração e testes de segurança periódicos. Contudo, não é possível garantir completamente a não ocorrência de interceptações e violações dos sistemas e bases de dados do iPaoo, uma vez que a internet possui sua estrutura de segurança em permanente aperfeiçoamento.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como iremos notificá-lo em caso de mudanças à essa política?</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">O iPaoo poderá atualizar essa Política de Privacidade periodicamente, sendo que a versão em vigor será sempre a mais recente.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Se fizermos alguma alteração na política em termos materiais, podemos colocar um aviso no nosso Website, Aplicativo ou te enviar um e-mail, juntamente com a Política de Privacidade atualizada. Por isso é sempre importante manter seus dados de contato atualizados.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Para verificar a data da versão em vigor, verifique a “Data de atualização” no início desse documento.</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\"><b style=\"line-height:1.1;margin-bottom:18px;font-size:16px;color:rgb(51,51,51);\"><span style=\"font-size:20px;color:rgb(255,0,0);line-height:1.1;margin-bottom:18px;\">Como entrar em contato com iPaoo em caso de dúvidas?</span></b></h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Se você tiver algum questionamento ou dúvida com relação à Política de Privacidade do iPaoo ou qualquer prática aqui descrita, entre em contato conosco no endereço através do e-mail ipaoo@ipaoo.com.br, ou através do link https://ipaoo.com.br/contact. Para que sua solicitação seja devidamente analisada por nós, ela deverá conter, no mínimo, as seguintes informações:</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Nome completo;</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Tipo e número de documento de identificação;</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Telefone para contato;</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">E-mail (o mesmo utilizado no cadastro do iPaoo);</h1><h1 style=\"line-height:1.1;margin-bottom:18px;font-size:16px;\">Descrição da dúvida ou motivos de eventual solicitação.</h1><p>Equipe iPaoo - A Padaria na porta da sua casa!</p><h1 style=\"color:inherit;font-family:inherit;font-size:36px;line-height:1.1;margin-bottom:18px;\"><br /></h1>','iPaoo A padaria na porta da sua casa!','Entrega de pães delivery ao cliente','iPaoo, Padaria, Padoca, pão, pães, bakery, entrega','','bottom2',7,'publish','2019-12-11 13:23:33','2020-01-08 23:38:44','189.79.97.21',2,1),(7,'codigo-de-etica-2','Código de Ética','<p style=\"text-align:center;\"><span style=\"font-size:28px;color:rgb(255,0,0);\">Código de Ética</span></p><p style=\"text-align:center;\"><span style=\"font-size:28px;color:rgb(255,0,0);\"><br /></span></p><p><span style=\"font-size:20px;color:rgb(255,0,0);\">1.INTRODUÇÃO </span></p><p>O iPaoo é uma Empresa que atua no segmento de Serviços de Tecnologia voltada a alimentos, visando o seu crescimento, dentro de princípios éticos e a satisfação dos seus clientes e instituições congêneres, buscando sempre manter sólida reputação, com a consciência de sua responsabilidade social e ambiental. Suas atividades devem sempre se pautar pela integridade, confiança e lealdade, bem como pelo respeito e valorização do ser humano e sua privacidade, individualidade e dignidade, sem quaisquer preconceitos e formas de discriminação. </p><p><span style=\"color:rgb(255,0,0);font-size:24px;\"><span style=\"font-size:20px;color:rgb(255,0,0);\">3.ABRANGÊNCIA</span></span></p><p> O Código de Ética contempla diretrizes de conduta baseadas em padrões éticos e morais que servirão de referencial para o comportamento de todos os colaboradores, internos e externos, cabendo a sua aplicação a todos os integrantes do quadro funcional da empresa iPaoo, no exercício de suas funções, inclusive prestadores de serviços, fornecedores e parceiros de negócios que se vinculam à instituição afim de sempre manter a qualidade de serviços, segurança, integridade e valores que precisam estar publicados aos interesses dos nossos clientes.</p><p><span style=\"font-size:20px;color:rgb(255,0,0);\">4.DIVULGAÇÃO</span></p><p>Este Código de Ética ficará publicamente disponível no website da Empresa no endereço https://www.ipaoo.com.br para consulta de todos os envolvidos a qualquer momento, cabendo ao Representante Legal da Empresa: (i) assegurar o cumprimento deste Código de Ética; (ii) dar ciência aos novos colaboradores sobre o Código de Ética, mantendo registro da ciência e concordância dos mesmos; (iii) promover a ampla divulgação do Código e suas atualizações ao corpo funcional da Empresa, clientes, prestadores de serviços e fornecedores; (iv) esclarecer dúvidas e verificar o entendimento quanto ao conteúdo e aplicação.</p><p><span style=\"font-size:20px;color:rgb(255,0,0);\">5.VALORES</span></p><p>• Respeito às pessoas. </p><p>• Responsabilidade social e cidadania.</p><p>• Integridade profissional e pessoal. </p><p>• Transparência nos processos. </p><p>• Orgulho de trabalhar na iPaoo. </p><p>• Gosto por desafios. </p><p>• Equidade de Gênero e Raça. </p><p>• Compromisso com resultados. </p><p>• Competência técnica. </p><p>• Confiança e credibilidade. </p><p>• Confidencialidade e segurança das informações.</p><p><span style=\"font-size:20px;color:rgb(255,0,0);\">6.PRINCÍPIOS ÉTICOS </span></p><p>Os dirigentes e os colaboradores da empresa iPaoo pautam suas ações pelos seguintes princípios, no relacionamento com os diversos setores da sociedade, assegurando:</p><p>6.1. AOS CLIENTES </p><p>6.1.1. O profissionalismo, a confiança e a transparência; </p><p>6.1.2. A disponibilidade de soluções que agreguem valor aos negócios de seus clientes, investindo, permanentemente, na busca de tecnologias adequadas e no aprimoramento das estratégias empresariais; </p><p>6.1.3. A valorização e o respeito ao cumprimento dos acordos e contratos, bem como aos direitos dos seus clientes;</p><p>6.1.4. A valorização das oportunidades de negócios e parcerias construídas com seus clientes, visando resultados em benefício da sociedade; e </p><p>6.1.5. A identificação, proposição e viabilização de soluções inovadoras e integradas que contribuem como reforço à legitimidade e sustentação de seus clientes.</p><p>6.2. AOS ÓRGÃOS GOVERNAMENTAIS </p><p>6.2.1. O reconhecimento do papel e apoio à atuação dos órgãos controladores, prestando-lhes informações pertinentes e confiáveis no tempo adequado;</p><p>6.3. ÀS PESSOAS </p><p>6.3.1. A manutenção de um ambiente de trabalho onde o relacionamento é baseado no profissionalismo, confiança, cooperação, integração, respeito às diferenças individuais e urbanidade; </p><p>6.3.2. O compartilhamento de seus conhecimentos e experiências, buscando o aprimoramento da capacitação técnica, dos métodos e dos processos, de maneira a atingir melhor resultado global da Empresa; </p><p>6.3.3. A valorização das pessoas, contribuindo para o seu desenvolvimento pessoal, técnico e profissional; </p><p>6.3.4. O zelo, permanente, pela utilização adequada e econômica dos recursos materiais, técnicos e financeiros da Empresa; </p><p>6.3.5. A preservação e respeito à imagem, ao patrimônio e aos interesses da Empresa; </p><p>6.3.6. O reconhecimento e valorização do capital intelectual da Empresa e o estímulo ao surgimento de novas lideranças; e </p><p>6.3.7. A valorização e o estímulo à conduta ética individual e coletiva.</p><p>6.4. AOS FORNECEDORES E EMPRESAS DE TERCEIRIZAÇÃO DE SERVIÇOS </p><p>6.4.1. A legalidade, a impessoalidade, a moralidade, a publicidade e a eficiência em todos os atos praticados; </p><p>6.4.2. A manutenção de um relacionamento pautado no respeito mútuo, preservação e confidencialidade das informações pertinentes à Empresa e seus clientes;</p><p>6.4.3. Relacionamento com fornecedores e parceiros que possuem práticas harmônicas ao padrão ético adotado pelo iPaoo e à moral social; </p><p>6.4.4. O estabelecimento de parcerias, desde que preservados a imagem e os interesses da empresa iPaoo;</p><p>6.4.5. A rejeição às disposições contratuais que afrontem ou minimizem a dignidade, a qualidade de vida e o bem-estar social dos empregados terceirizados.</p><p>6.5. À REPRESENTAÇÃO DOS EMPREGADOS, ASSOCIAÇÕES E INSTITUIÇÕES </p><p>6.5.1. O reconhecimento à legitimidade e manutenção de um diálogo permanente com as instituições representativas dos trabalhadores, legalmente constituídas, mantendo canais de diálogo pautados no respeito mútuo, seriedade, responsabilidade e transparência nas relações; </p><p>6.5.2. A negociação como instrumento adequado para buscar a integração e a convergência; e </p><p>6.5.3. O cumprimento das determinações explicitadas nos instrumentos que regulam a relação da Empresa com seus empregados.</p><p>6.6. À COMUNIDADE </p><p>6.6.1. O estabelecimento de relações justas e equilibradas com a comunidade por meio do incentivo, promoção, apoio e participação em ações de responsabilidade social e cidadania; </p><p>6.6.2. O incentivo, apoio e participação em ações governamentais voltadas para o desenvolvimento social e o combate à pobreza; e </p><p>6.6.3. O estímulo às iniciativas socioculturais e esportivas de seus empregados.</p><p><span style=\"font-size:20px;color:rgb(255,0,0);\">7. CÓDIGO DE CONDUTA EMPRESARIAL </span></p><p>Os dirigentes e empregados do iPaoo devem pautar seu comportamento por este Código de Conduta Empresarial, nos termos enumerados a seguir.</p><p>7.1. Condutas aceitáveis aos dirigentes e empregados da empresa iPaoo: </p><p>7.1.1. Preservar e cultivar a imagem positiva da Empresa; </p><p>7.1.2. Comercializar, nas dependências da Empresa, apenas os produtos e serviços de propriedade e de interesse da empresa iPaoo; </p><p>7.1.3. Desenvolver condições propícias ao estabelecimento de um clima produtivo e agradável no ambiente de trabalho; </p><p>7.1.4. Tratar as pessoas e suas ideias com dignidade e respeito; </p><p>7.1.5. Proceder com lealdade, justiça e franqueza nas relações do trabalho; </p><p>7.1.6. Preservar o bem-estar da coletividade, respeitando as características pessoais, a liberdade de opinião e a privacidade de cada um; </p><p>7.1.7. Agir com clareza e lealdade na defesa dos interesses da empresa iPaoo; </p><p>7.1.8. Apresentar-se de forma adequada para o desempenho de suas funções e atividades na Empresa; </p><p>7.1.9. Abster-se de utilizar influências internas ou externas, para a obtenção de vantagens pessoais e funcionais; </p><p>7.1.10. Eximir-se de fazer uso do cargo, da função de confiança ocupada ou da condição de empregado da empresa iPaoo para obter vantagens para si ou para terceiros; </p><p>7.1.11. Utilizar os recursos da empresa iPaoo apenas para finalidades de interesse da Empresa; </p><p>7.1.12. Contribuir para o bom funcionamento de toda a Empresa, abstendo-se de atos e atitudes que impeçam, dificultem ou tumultuem a prestação de serviços; </p><p>7.1.13. Recusar de pessoas físicas e/ou jurídicas que mantenham relações comerciais com a iPaoo presentes e/ou brindes. </p><p>7.1.14. Não elaborar e apresentar informações que reflitam reais posições e resultados econômicos, financeiros, operacionais, logísticos e quaisquer outros que afetem o desempenho da Empresa; </p><p>7.1.15. Priorizar e preservar os interesses da empresa iPaoo junto a clientes, órgãos governamentais, instituições financeiras, fornecedores, entidades e outras empresas com as quais iPaoo mantenha relacionamento comercial; </p><p>7.1.16. Estar acompanhado, de outro empregado ou da chefia ou de um par, ao manter qualquer relacionamento com fornecedor ou parceiro que resulte ou que possa resultar em contratação que atenda a interesse ou necessidade da empresa iPaoo; </p><p>7.1.17. Prestar estrita anuência com as diretrizes e a condução estratégica empresarial ao assumir função de confiança da Empresa; e,</p><p>7.1.18. Renunciar ao exercício da função de confiança para a qual tenha sido designado, quando houver dissonância com as diretrizes e orientações estratégicas empresariais.</p><p>7.2. Condutas inaceitáveis aos dirigentes e aos empregados da empresa iPaoo: </p><p>7.2.1. Reivindicar benefícios ou vantagens pessoais para si próprio ou para terceiros, em decorrência de relacionamento comercial ou financeiro firmado em nome da empresa iPaoo com clientes, órgãos governamentais, instituições financeiras, fornecedores, entidades e outras empresas com as quais a iPaoo mantenha este relacionamento; </p><p>7.2.2. Ser conivente ou omisso em relação a erros e infrações a este Código de Ética e às disposições legais e regulamentares vigentes; </p><p>7.2.3. Exercer outras atividades profissionais durante o expediente, com ou sem fins lucrativos, ou ainda, independentemente da compatibilidade de horários, exercer atividades que constituam prejuízo, concorrência direta ou indireta com as atividades da empresa iPaoo; </p><p>7.2.4. Exercer qualquer tipo de discriminação a pessoas por motivos de natureza econômica, social, política, religiosa, de cor, de raça ou de sexo; </p><p>7.2.5. Permitir que perseguições, simpatias, antipatias, caprichos, paixões ou interesses de ordem pessoal interfiram nas suas relações profissionais; </p><p>7.2.6. Prejudicar deliberadamente a reputação de empregado da Empresa ou de qualquer outro profissional com quem a iPaoo mantenha relacionamento comercial; </p><p>7.2.7. Prejudicar deliberadamente a reputação dos clientes, órgãos governamentais, fornecedores, entidades e outras empresas com as quais a empresa iPaoo mantenha relacionamento comercial; </p><p>7.2.8. Pleitear, solicitar ou receber presentes, ou vantagens de qualquer espécie, para si ou para terceiros, além da mera insinuação ou provocação para o benefício que se dê, em troca de concessões ou privilégios de qualquer natureza junto a iPaoo; </p><p>7.2.9. Priorizar e preservar interesses pessoais, de clientes, órgãos governamentais, instituições financeiras, fornecedores, entidades e outras empresas, em detrimento dos interesses da empresa iPaoo; </p><p>7.2.10. Obter vantagens, para si ou para terceiros, decorrente do acesso privilegiado a informações da empresa iPaoo, mesmo que não acarretem prejuízo para a Empresa; </p><p>7.2.11. Utilizar em benefício próprio ou repassar a terceiros, documentos, trabalhos, metodologias, produtos, ferramentas, serviços e informações de propriedade da empresa iPaoo ou de seus clientes e fornecedores, salvo por determinação legal ou judicial; </p><p>7.2.12. Manifestar-se em nome da Empresa, por qualquer meio de divulgação pública, quando não autorizado ou habilitado para tal;</p><p>7.2.13. Fazer uso inadequado e antieconômico dos recursos materiais, técnicos e financeiros da Empresa; </p><p>7.2.14. Impedir ou dificultar a apuração de irregularidades cometidas na Empresa; </p><p>7.2.15. Alterar ou deturpar o teor de qualquer documento, informação ou dado de responsabilidade da Empresa ou de terceiros; </p><p>7.2.16. Facilitar ações de terceiros que resultem em prejuízo ou dano para a Empresa; </p><p>7.2.17. Gerar qualquer tipo de confusão patrimonial entre os bens da Empresa e seus próprios bens, independentemente de advirem vantagens pecuniárias dessa confusão; e</p><p>7.2.18. Manter-se no exercício da função de confiança para a qual tenha sido designado, quando houver dissonância com as diretrizes e orientações estratégicas empresariais.</p><p><span style=\"font-size:20px;color:rgb(255,0,0);\">8. CUMPRIMENTO DO CÓDIGO DE ÉTICA </span></p><p>Em caso de dúvidas sobre qual deve ser a conduta correta a adotar, o colaborador deve procurar ajuda de forma sincera e transparente. </p><p>Deve ser comunicada imediata e formalmente ao Representante Legal da Empresa, qualquer situação que possa caracterizar conflito de interesses, ou fatos que possam prejudicar a Empresa ou que contrariem os princípios deste Código. </p><p>A Empresa assegura a confidencialidade na condução destes assuntos e o compromisso de apuração dos casos relatados. </p><p>Situações que, porventura, não estejam aqui explicitadas, serão tratadas como exceção e encaminhadas ao Representante Legal da Empresa que analisará e decidirá dentro dos princípios deste Código. </p><p>Este Código de Ética reflete os valores e a cultura da empresa iPaoo e o seu cumprimento revelam o compromisso de profissionalismo e transparência em todas as nossas ações no trabalho. </p><p>O desrespeito ao Código de Ética sujeitará os colaboradores às ações disciplinares, podendo resultar inclusive na sua demissão por justa causa e em processo legal.</p><p>Todos que se relacionam de forma direta ou indireta com a empresa iPaoo, devem conhecer e zelar pelo cumprimento deste Código, tendo os mesmos compromissos éticos, indistintamente do cargo que ocupam. </p><p>A não observância de quaisquer das práticas e/ou procedimentos aqui descritos pode influir na credibilidade da imagem institucional da empresa iPaoo, perante os clientes, mercado, órgãos supervisores e regulamentadores, governo e a sociedade em geral. </p><p>Este Código entra em vigor a partir da data de sua divulgação. A cada 12 meses deve ser atualizado, ou quando da alteração de legislações, regulamentações e/ou normas que possam demandar sua revisão</p><p><br /></p>','Código de Ética','Código de Ética do iPaoo','iPaoo, Padaria, Código de Ética','','bottom2',6,'publish','2019-12-12 08:33:56','2020-01-08 23:38:44','189.79.97.21',2,1),(8,'','Fale Conosco','https://ipaoo.com.br/contact','','','','','bottom',5,'publish','2019-12-19 09:58:35','2020-01-08 23:38:44','189.79.97.21',2,2),(9,'','Cadastro do Entregador','https://ipaoo.com.br/driver_signup','','','','','bottom',4,'publish','2019-12-19 09:59:16','2020-01-08 23:38:44','189.79.97.21',2,2),(10,'','Padarias do Brasil','https://ipaoo.com.br/browse','','','','','bottom',3,'publish','2019-12-19 10:00:44','2020-01-08 23:38:44','189.79.97.21',2,2),(12,'','Blog do iPaoo','https://blog.ipaoo.com.br/','','','','','bottom',2,'publish','2020-01-08 17:31:54','2020-01-08 23:38:44','189.79.97.21',2,2),(13,'principais-duvidas','Psiu, ainda com dúvidas?','<p><br /></p><p style=\"text-align:center;font-size:24px;\">Tire as suas dúvidas dessa nova tendência de mercado e fature em dobro!</p><p><br /></p><p></p><p><span style=\"font-weight:700;\">1) O que é o iPaoo?</span></p><p>Resposta = o iPaoo surgiu de uma necessidade em ter o seu café da manhã entregue em sua casa, por isso criamos um aplicativo exclusivo para produtos de padaria, onde o cliente faz o pedido através do aplicativo do iPaoo, o comerciante recebe o pedido através da tela de gerenciamento do ADM ou do APP do comerciante, separa os produtos e solicita a presença do entregador que receberá o chamado através do App do Entregador para buscar o seu produto e entregá-lo até o cliente final.</p><p><b>2) Qual o risco que vou correr?</b></p><p>Resposta = <b><i>NENHUM</i></b>, pois, caso você <b><i>NÃO</i></b> esteja satisfeitos durante os 30 primeiros dias (Pacote de 30 dias) devolveremos o valor integral por deposito em sua conta e se em 3 meses também não estiver satisfeitos (Pacote de 90 dias) com o aumento das vendas, o iPaoo devolverá o valor em <b><i>DOBRO</i></b> a você.</p><p><b>3) O que eu ganho com isso?</b></p><p><b>Resposta = Você poderá duplicar seu faturamento (dependendo do seu esforço) aumentando seu raio de atendimento com a nova demanda de clientes via delivery, dará</b><b> uma visão de inovação em seu estabelecimento saindo a frente dos seus concorrentes e ainda terá risco ZERO.</b></p><p><b>4) A cobrança é baseado em um pacote mensal + comissão?</b></p><p>Resposta= Não, o iPaoo cobra apenas um valor fixo mensal</p><p><b>3) Após iniciar as vendas como irei vender se não tenho entregador?</b></p><p>Resposta = Assim que você realizar a compra do pacote, nós do iPaoo iremos realizar um trabalho para entrar em contato com os entregadores em sua região através da divulgação em nossas redes sociais de comunidades de entregadores. Após isso, através do app do iPaoo dos entregadores os mesmos receberão os pedidos vendidos por você para ir buscar em seu comércio e entregar ao seu cliente final, esse app está disponível no Google Play e no Apple Store.</p><p><b>4) Como vou conseguir aumentar minhas vendas e divulgar meu novo serviço no iPaoo?</b></p><p>Resposta = Assim que fechado o pacote desejado, o iPaoo irá apoiá-lo na divulgação em nossas redes sociais como Instagram, Facebook, Pinterest, Blog do iPaoo e em nosso Website para que você consiga ter a sua própria vitrine de divulgação, vamos também enviar um kit iPaoo (exceto pacote básico) para colocar em seu comércio divulgado essa nova tendência para as padarias.</p><p><b>5) Minha padaria é convencional por isso, o que será necessário para operar em meu comércio?</b></p><p>Resposta = Apenas um desktop e uma impressora e se preferir um celular para receber os pedidos através do App do Comerciante.</p><p><b>6) Porque eu iria contratar essa nova solução se hoje tenho a minha Padaria convencional?</b></p><p>Resposta = Você gosta de dinheiro? Imagine o quanto as pizzarias deixaram de ganhar dinheiro em não contratar a solução de pedidos via aplicativo? e as que foram as primeiras a contratarem esse serviço, será que reclamam de vendas? veja essa nova tendência de mercado versus o quanto o seu cliente final está mais exigente e reavalie a sua decisão, </p><p><b>7) Porque contrataria o iPaoo se temos outros players no mercado com alimentos de delivery?</b></p><p>Resposta = A empresa iPaoo é focada em produtos de padaria, ou seja, temos apenas uma linha de segmento para demanda de Padarias  e esse é o nosso principal diferencial de mercado, por isso estamos entrando tão forte no mercado</p><p><b>8) Contratei o pacote e agora por onde começo?</b></p><p>Resposta = Ao contratar o pacote desejado você receberá um manual passo a passo para iniciar as configurações de divulgação dos seus produtos e parametrização do layout da sua página em nosso website que automaticamente estará também divulgando no aplicativo do IPaoo, ou seja, a ferramenta é muito simples sendo possível já iniciar as suas vendas  com pouco esforço e gradualmente ir colocando mais produtos para enriquecer sua variedade de opções.</p><p><b>9) Como será mostrando o meu produto para o cliente final?</b></p><p>Resposta = Pelo portal e pelo aplicativo do iPaoo, será disponibilizado uma página exclusiva para o estabelecimento onde seus produtos estarão disponíveis para venda e será necessário inserir apenas uma vez o produtos que estará disponível em nosso website e no App do cliente do iPaoo.</p><p><b>10) Então o que exatamente o pacote inclui?</b></p><p>Resposta a seguir: </p><p>-Um portal exclusivo para você divulgar seus produtos, </p><p>-O app do cliente para receber os seus pedidos, </p><p>-O acesso ADM para você controlar as suas vendas através de relatórios, receber seus pedidos e divulgar seus produtos, </p><p>-O App do estabelecimento que você poderá receber os pedidos, separá-los e solicitar os entregadores</p><p>-Um acesso ADM para gerenciar os seus entregadores.</p><p><b>13) Qual o valor do pacote e como poderei efetuar o pagamento</b></p><p>Resposta = Imagina qual é o investimento gasto em ter uma solução dessas X o valor de retorno que você poderá ter? Imagine todo esse custo e avalie a nossa tabela de preços clicando  nesse <a href=\"https://ipaoo.com.br/merchantsignup\">link</a> ou clique no meu superior do nome \"Cadastre a sua padaria \".</p><p><br /></p><p>Em caso de mais dúvidas envie um e-mail para administrador@ipaoo.com.br ou envie uma mensagem em nosso Whatsapp no número (011)97787-0076</p><p>Obrigado</p><p>Equipe iPaoo</p><p><br /></p><p><br /></p><p><br /></p><p><br /></p>','iPaoo - Principais dúvidas','iPaoo aumento nas vendas','Padaria na porta da sua casa por delivery','','bottom',1,'publish','2020-01-08 23:38:11','2020-01-14 13:41:03','189.69.123.130',2,1);
