order_id] From [customer_name]'),(41,0,'receipt_send_to_admin_tpl_content_en','hi admin,\n\nThere is a new order to [restaurant_name]\nwith the reference number [order_id] from customer [customer_name]\n\n[receipt]\n\nAccept Order\n[accept_link]\n\nDecline Order\n[decline_link]\n\nKind Regards'),(42,0,'receipt_send_to_admin_sms_content_en','New Order : [order_id] From [customer_name]\ntotal amout : [total_amount]\ndetails : [order_details]'),(43,0,'offline_bank_deposit_tpl_subject_en','Bank deposit instructions'),(44,0,'offline_bank_deposit_tpl_content_en','Hi [restaurant_name]\n\nDeposit Instructions\n\nPlease deposit [amount] to :\n\nBank : Your bank name\nAccount Number : Your bank account number\nAccount Name : Your bank account name\n\nWhen deposit is completed \nfill in your bank deposit information \n[verify_payment_link]\n\n\nKind Regards\n  -[sitename]'),(45,0,'offline_bank_deposit_signup_merchant_tpl_subject_en','Instruções para deposito em conta!'),(46,0,'offline_bank_deposit_signup_merchant_tpl_content_en','Obrigado por nos escolher [restaurant_name]\r\n\r\nSegue abaixo instruções para efetuar o deposito em C/C\r\n\r\nValor do depósito [amount] para :\r\n\r\nBanco : Itau\r\nAgencia : 8317\r\nC/C: 12204-5\r\nNome : Marcio Takara\r\nCPF: 262.877.438-08\r\n\r\nAssim que o deposito for efetuado, clique no link a seguir e envie o comprante para a ativação do seu ambiente.\r\n[verify_payment_link] ou envie o comprovante para administrador@ipaoo.com.br que a liberação será efetuada em poucos minutos.\r\n\r\nSucesso e boas vendas!!\r\n  -[sitename] a padaria na porta da sua casa!'),(47,0,'offline_bank_deposit_signup_merchant_email','1'),(48,0,'offline_bank_deposit_purchase_email','1'),(49,0,'offline_bank_deposit_purchase_tpl_subject_en','Instruções para deposito em conta : [order_id]'),(50,0,'offline_bank_deposit_purchase_tpl_content_en','Obrigado por nos escolher [customer_name]\r\n\r\nSegue abaixo intruções para efetuar o deposito em C/C\r\n\r\nValor do depósito [amount] para :\r\n\r\nBanco : Itau\r\nAgencia : 8317\r\nC/C: 12204-5\r\nNome : Marcio Takara\r\n\r\nAssim que o deposito for efetuado, clique no link a seguir e envie o comprante para a ativação do seu ambiente.\r\n[verify_payment_link] ou envie o comprovante para administrador@ipaoo.com.br que a liberação será efetuada em poucos minutos.\r\n\r\nSucesso e boas vendas!!\r\n  -[sitename]'),(51,0,'merchant_near_expiration_email','1'),(52,0,'merchant_near_expiration_sms','1'),(53,0,'merchant_near_expiration_tpl_subject_en','Your membership about to expired'),(54,0,'merchant_near_expiration_tpl_content_en','hi [restaurant_name]\n\n Your membership is about to expire in [expiration_date]\n\nRegards\n - [sitename]'),(55,0,'merchant_near_expiration_sms_content_en','hi [restaurant_name]\n Your membership is about to expire in [expiration_date]\nRegards\n - [sitename]'),(56,0,'merchant_near_expiration_day','5'),(57,0,'merchant_change_status_email','1'),(58,0,'merchant_change_status_tpl_subject_en','Account Status Updated'),(59,0,'merchant_change_status_tpl_content_en','hi [restaurant_name]\n\nYour merchant records status has change to [status]\n\nRegards\n - [sitename]'),(60,0,'merchant_change_status_sms_content_en','hi [restaurant_name]\n\nYour merchant records status has change to [status]\n\nRegards\n - [sitename]'),(61,0,'customer_booked_email','1'),(62,0,'customer_booked_tpl_subject_en','We have receive your Booking'),(63,0,'customer_booked_tpl_content_en','Hi [customer_name]\n\nwe have receive your booking \nfor restaurant [restaurant_name]\nwith the following information\n\nNumber of guest : [number_guest]\nDate of Booking : [date_booking]\nTime : [time]\nEmail address : [email]\nMobile  : [mobile]\nSpecial instruction : [instruction]\n\nYour booking id : [booking_id]\n\nPlease wait for the merchant to accept your booking.\nyou will receive another email for confirmation from the merchant\n\nRegards\n - [sitename]'),(64,0,'booked_notify_admin_email','1'),(65,0,'booked_notify_admin_tpl_subject_en','New booking from [restaurant_name]'),(66,0,'booked_notify_admin_tpl_content_en','hi admin\n\nthere is new booking from [restaurant_name]\nwith the following information\n\nBooking ID : [booking_id]\nName : [customer_name]\nNumber of guest : [number_guest]\nDate of Booking : [date_booking]\nTime : [time]\nEmail address : [email]\nMobile  : [mobile]\nSpecial instruction : [instruction]\n'),(67,0,'booked_notify_merchant_tpl_subject_en','New booking from [customer_name]'),(68,0,'booked_notify_merchant_tpl_content_en','hi [restaurant_name]\n\nthere is new booking from [customer_name]\nwith the following information\n\nBooking ID : [booking_id]\nName : [customer_name]\nNumber of guest : [number_guest]\nDate of Booking : [date_booking]\nTime : [time]\nEmail address : [email]\nMobile  : [mobile]\nSpecial instruction : [instruction]\n\n'),(69,0,'booking_update_status_tpl_subject_en','Update with your booking id [booking_id]'),(70,0,'booking_update_status_tpl_content_en','Hi [customer_name]\n\nYour booking id [booking_id]\nstatus updated to [status]\n\nmerchant remarks :\n[merchant_remarks]\n\nRegards\n - [sitename]'),(71,0,'merchant_welcome_signup_email','1'),(72,0,'merchant_welcome_signup_tpl_subject_en','Seja muito Bem vindo [restaurant_name]'),(73,0,'merchant_welcome_signup_tpl_content_en','Parabéns, você acaba de abrir uma conta no iPaoo com a sua padaria de nome  [restaurant_name]\r\n\r\nEstamos enviando outro e-mail em seguida com as instruções de deposito em conta e recomendamos olhar em sua caixa de Spam caso não encontre e assim que identificarmos o pagamento estaremos ativando a sua conta em poucos minutos.\r\n\r\nEm caso de urgência, envie o comprovante para administrador@ipaoo.com.br.\r\n\r\nApós a ativação segue abaixo os dados para acesso:\r\n\r\nClique no link abaixo\r\n\r\nLogin do Estabelecimento\r\n[login_url]\r\n\r\nUsuário e senhas são os mesmos cadastrados em seu perfil.\r\n\r\nSucesso e boas vendas!\r\n Equipe [sitename]\r\n'),(74,0,'order_idle_to_merchant_tpl_subject_en','Order ID [order_id] has been IDLE for [idle_time]'),(75,0,'order_idle_to_merchant_tpl_content_en','hi [restaurant_name]\n\nKindly take  action on Order ID : [order_Id]\n\nRegards\n- [sitename]'),(76,0,'order_idle_to_merchant_sms_content_en','hi [restaurant_name]\n\nKindly take action on Order ID : [order_Id]\n\nRegards\n- [sitename]'),(77,0,'order_idle_to_admin_tpl_subject_en','Order ID [order_id] has been IDLE for [idle_time]'),(78,0,'order_idle_to_admin_tpl_content_en','hi admin\n\nKindly take action on Order ID : [order_id]\n\nRegards\n- [sitename]'),(79,0,'order_idle_to_admin_sms_content_en','hi admin\n\nKindly take action on Order ID : [order_Id]\n\nRegards\n- [sitename]'),(80,0,'merchant_invoice_email','1'),(81,0,'merchant_invoice_tpl_subject_en','Your new Invoice : [invoice_number]'),(82,0,'merchant_invoice_tpl_content_en','hi [restaurant_name]\n\nyour invoice is now ready\nInvoice number : [invoice_number]\nTerms : [terms]\nPeriod : [period]\n\nYou can donwload your invoice below\n[invoice_link]\n\nRegards\n - [sitename]'),(83,0,'admin_decimal_place','2'),(84,0,'installation_done','1'),(85,0,'website_disbaled_auto_cart','yes'),(86,0,'website_enabled_mobile_verification',''),(87,0,'website_date_picker_format','dd-mm-yy'),(88,0,'website_time_picker_format','24'),(89,0,'website_date_format','d M, Y'),(90,0,'website_time_format',''),(91,0,'merchant_sigup_status','pending'),(92,0,'merchant_email_verification','yes'),(93,0,'merchant_payment_enabled',''),(94,0,'admin_enabled_paypal','yes'),(95,0,'admin_enabled_card','yes'),(96,0,'admin_currency_set','BRL'),(97,0,'home_search_text','Chegamos!! <br> iPaoo, a padaria na porta da sua casa!'),(98,0,'home_search_subtext',''),(99,0,'home_search_mode','address'),(100,0,'website_logo','1569975728-logo-ipaoo.png'),(101,0,'admin_use_separators',''),(102,0,'google_auto_address',''),(103,0,'home_search_radius','5'),(104,0,'home_search_unit_type','km'),(105,0,'google_default